import React, { Component, useState } from 'react'

import MovieCards from './MovieCards'
const MovieList= ({movies}) => {
    

    return (
        <div>

            {movies.map((list,index)=><MovieCards list={list} />)}

        </div>
    )

}
export default MovieList
